static byte* db64(char const *bs, int n, int *sz)
{
    n &= -4, *sz = n / 4 * 3;
    byte *re = malloc(*sz), *p = re;
    byte u, v, w, t;

    for (int i = 0; i < n; i += 4)
    {
        if ((u = bs[i + 0]) > 127
         || (v = bs[i + 1]) > 127
         || (w = bs[i + 2]) > 127
         || (t = bs[i + 3]) > 127
         || (u = b_table[u]) > 63
         || (v = b_table[v]) > 63
         || (w = b_table[w]) > 64
         || (t = b_table[t]) > 64)
        {
            free(re);
            return NULL;
        }

        p[0] = u << 2 | v >> 4;

        if (w == 64)
        {
            return (*sz -= 2, re);
        }

        p[1] = v << 4 | w >> 2;

        if (t == 64)
        {
            return (*sz -= 1, re);
        }

        p[2] = w << 6 | t, p += 3;
    }

    return re;
}


static byte fonLoad_em(Qfon_ctx *c)
{
    int sz, n = sizeof(fn_b64) - 1;
    c->data = db64(fn_b64, n, &sz);
    c->ch_cb = 2, c->ch_ro = 16;
    return (c->ch_ct = sz / 32, 0);
}

static void fonFree(Qfon_ctx *c)
{
    free(c->data);
}

static byte fonDrawPix(Qfon_ctx *c,
  byte *mat, ui16 mw, char const *str)
{
    ui16 sz = c->ch_cb * c->ch_ro;
    ui16 cw = c->ch_cb * 8;
    ui32 dpt = mw - cw, id;
    byte c0, c1;

    for (ui32 of = 0; *str; of += cw)
    {
        if ((c0 = *str++) < 161)
        {
            if (c0 < 32 || c0 > 126)
            {
                puts("fonDrawPix():"
                 "ASCIIМ│╔С╩Д░▄БА");
                return 1;
            }

            id = c0 > 32? (c0 < 126?
              c0 + 155 : 10) : 0;
        }
        else
        {
            if ((c1 = *str++) < 161)
            {
                puts("fonDrawPix():"
                 "▓╗оД│ох─Ооич▒Я┬вБА");
                return 1;
            }

            c0 -= 161;
            id = 94 * c0 + c1 - 161;
        }

        if (id >= c->ch_ct)
        {
            puts("fonDrawPix():"
             "Ооич┤«─┌░Ч║г╚▒╩Д║║ОоБА");
            return 1;
        }

        byte *p = c->data + id * sz;
        byte *pmt = mat + of;
        ui16 chro = c->ch_ro;

        for ( ; chro--; pmt += dpt)
        {
            ui16 ccb = c->ch_cb;

            for ( ; ccb--; pmt += 8)
            {
                byte b = *p++, i = 8;

                for ( ; i; b >>= 1)
                {
                    pmt[--i] = b & 1;
                }
            }
        }
    }

    return 0;
}

static byte fonAscIIArt(Qfon_ctx *c,
           ui32 cs, char const *u,
     char const *v, char const *s)
{
    ui16 r = c->ch_ro;
    ui32 w = c->ch_cb * cs * 8; 
    byte *b = calloc(w, r), *p;

    if (fonDrawPix(c, b, w, s))
    {
        return 1;
    }

    for (p = b; r--; puts(""))
    {
        for (ui32 i = w; i--; )
        {
            fputs(*p++? v : u,
                       stdout);
        }
    }

    free(b);
    return (fflush(stdout), 0);
}
